"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[977],{977:e=>{e.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"సాన్ మాటెయో కౌంటీ ప్రైడ్ సెంటర్","description":"సాన్ మాటెయో కౌంటీ ప్రైడ్ సెంటర్ ఒక సహకార మోడల్ సంస్ధ మరియు LGBTQ+ సముదాయానికి ఒక ఐక్య శాప్. మామూలు పరిశోధనలు, సేవల మరియు పోషకత్వాంశాలు అందిస్తోంది , అన్ని వయసు వర్గాల LGBTQ+ సముదాయ సభ్యులకు పఠన, శిక్షణ, సముదాయ కార్యక్రమాలు, సహపాఠి మద్దతు సమూహాలు, రోజువారీ ప్రోగ్రమింగ్, క్లినికల్ చికిత్స, మరియు కేస్ మేనేజ్మెంట్."},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"డూ-ఇట్-యొవర్సెల్ఫ్ హార్మోన్ రిప్లేస్మెంట్ థెరపీ (HRT) పై ఆసక్తి ఉన్న వ్యక్తుల కోసం తెలివైన సముదాయం మరియు జ్ఞాన కేంద్రం ఏదైనా DIYHRT.cafe. వారి వెబ్‌సైట్ స్వయం నిర్వహించే HRTకు సమాచారం, వనరులు, మరియు మద్దతును ఆందోళన చేసే సురక్షిత మరియు సమావేశక స్థలంగా ఉంది. మీరు ప్రత్యామ్నాయ పద్ధతులను అన్వేషిస్తున్నారా, డోసేజీ మరియు నిర్వహణ పై మార్గదర్శనను శోధిస్తున్నారా, లేదా మీకు అనుభవాలు ఉన్నవారితో కనెక్ట్ చేయాలని కోరుకుంటున్నారా, DIYHRT.cafe మీ ఆరోగ్య మరియు సంకల్పాత్మక నిపుణ సలహా, వ్యక్తిగత కథనాలు, మరియు అరుదైన సమాచారాన్ని అందించడానికి సంపన్నం."},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"మహిళల నుండి పురుషుడికి (FTM) మారుస్థితికి వెళ్లుతున్న వ్యక్తులకు మద్దతు ప్రదానించే వ్యాపక ఆన్‌లైన్ వేదిక \'FTMGuide.org\'. వారి వెబ్‌సైట్‌ ఒక విశ్వసనీయ సంసాధనంగా పనిచేస్తుంది, FTM యాత్రలో నిర్గమించడం కొరకు సమాచార యన్నియం, మార్గదర్శనం, కమ్మునిటీ కనెక్షన్‌లను అందిస్తుంది. హార్మోన్ చికిత్స మరియు శస్త్ర ప్రయోగాలపై ప్రాక్టికల్ సలహా నుండి మానసిక ఆరోగ్య మద్దతు మరియు వ్యక్తిగత కథల వరకు, FTMGuide.org వ్యక్తులకు ఆవశ్యక జ్ఞానం మరియు సంసాధనాలను అందించడానికి మరియు వారి మారుస్థితిని ఆత్మవిశ్వాసంతో మరియు స్పష్టతతో నడిచేందుకు ప్రయత్నిస్తుంది."},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"ఎవిడెన్స్-బేస్డ్ రీసెర్చ్, ఎడ్యుకేషన్, మరియు ట్రాన్స్జెండర్ మరియు నాన్-బైనరీ కమ్మునిటీకు సమర్పించిన సంక్షిప్తమైన ఆన్‌లైన్ వేదిక \'transfemscience.org\', ముఖ్యంగా స్త్రీ హార్మోన్ చికిత్స (FHT) పై కేంద్రీకృత గా ఉంది. వారి వెబ్సైట్ సమాచారం, శారీరక మరియు మానసిక అంగాలపై విశ్వసనీయ మరియు తాజా సమాచారాన్ని కోరుతున్న వ్యక్తులకు మైన కేంద్రంగా పని చేస్తుంది. వారి సమగ్ర సపీర్-రివ్యూ పరిశోధనల, నిపుణుల వ్యాసాల, మరియు ప్రయోజనకర గైడ్‌ల సంగ్రహం ద్వారా, వారి సైట్ వ్యక్తులకు వారి మార్పు మరియు ఆరోగ్యం గురించి సమాజ్ఞ తీర్పులను సాధించటానికి అధికారికతని ఇస్తుంది."},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"జెండర్ డిస్ఫోరియా గురించి జ్ఞానం, మద్దతు, మరియు అర్ధం శోధిస్తున్న వ్యక్తులకు విశ్వసనీయ ఆన్‌లైన్ జాబితా. వారి వెబ్‌సైట్ సమాచారం, వనరులు మరియు సముదాయ అనుబంధాలను అందించి, వ్యక్తులను వారి ప్రయాణంలో సమర్థించేందుకు రాణిస్తుంది. జెండర్ గుర్తింపు మరియు మార్పును గురించి సమగ్ర మార్గదర్శకాల నుంచి వ్యక్తిగత కథలు మరియు నిపుణుల సలహాల వరకు, వారు అన్నివారికీ సురక్షితమైన మరియు సమగ్రత స్థానం సృష్టించడానికి సాధిస్తుంది."},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"చలన ముందుగాచే ప్రాజెక్టు","description":"చలన ముందుగాచే ప్రాజెక్టు (MAP) ఒక స్వతంత్ర, గైరి లాభపర ఆలోచనా సంస్థ అని. ఇది ఖచ్చితమైన పరిశోధన, ఆలోచనలు, మరియు ప్రచారసరణిలను అందిస్తుంది ఏమితితో సమస్తులకు సరేసారి మరియు అవకాశాలను వేగవంతగా తీసుకోవడానికి సహాయముచేస్తుంది. MAP అందరికీ ఆరోగ్యవంతమైన మరియు సంతృప్తిని అనుసరించే అవకాశం, బతుకుందాం, వారి ప్రేమ మితులాను కాపాడుకోవడానికి, వారి ఆదివారిలో సురక్షితంగా ఉండటం, మరియు నగరసభలో పాల్గొనడానికి ఒక సమానమైన అవకాశం ఉన్నత ఉండాలని ప్రయత్నిస్తుంది."},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"జోర్డాన్ రోస్ కమ్యునికేషన్ సర్వీసెస్","description":"జోర్డాన్ రోస్ ట్రాన్స్, క్వీర్ మరియు జెండర్ నాన్-కన్ఫార్మింగ్ వ్యక్తుల కోసం ప్రసంగ, స్వరం మరియు కమ్యునికేషన్ కోచింగ్‌ను అందిస్తున్నారు. అతను 1-మీద-1 కోచింగ్, ఆన్‌లైన్ కోర్సులు, ఈవెంట్స్, మరియు \'వాయిస్ వితిన్ కోచింగ్ ప్రోగ్రామ్\'‌ను అందిస్తున్నారు. అతని దాదాపు న్యూరో-లింగ్విస్టిక్ ప్రోగ్రామింగ్, హైప్నోథెరపీ, యోగా గురుత్వం, మరియు శ్వాస కోచింగ్ ఆకలికతలతో, శారీరికమైనవి కాకుండా మానసిక, భావోద్వేగ, మరియు ఊర్జా కమ్యునికేషన్ యొక్క అంశాలను ఘట్టించడానికి ప్రయత్నిస్తుంది."},{"id":"4465cbb7-3513-41ae-8878-7a86ebbe9f6a","slug":"gender-dynamix-online-education-portal","externalUrl":"https://www.genderdynamix.org.za/","tags":["transfeminine","transmasculine","non-binary","legal","healthcare","education-awareness","support-groups","community-stories"],"address":"7, 10 Anson St, Observatory, Cape Town, 7925, South Africa","phoneNumber":"+27 (0)21 447 4797","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9368811,18.470378],"email":"info@genderdynamix.org.za","socialMedia":null,"town":"Observatory","title":"జెండర్ డైనమిక్స్ ఆన్‌లైన్ ఎడ్యుకేషన్ పోర్టల్","description":"జెండర్ డైనమిక్స్ ఒక ఆఫ్రికా-ఆధారిత నాన్‌ప్రాఫిట్ సంస్థ అనిగి, దాని లక్ష్యం దక్షిణాఫ్రికా మరియు దక్షిణ ఆఫ్రికాలోని ట్రాన్స్ మరియు జెండర్ది వివిధత సమాజాల మానవ హక్కులను ప్రోత్సహించడం, సాగించడం మరియు సంరక్షించడం అని. ఈ సంస్థ ప్రజా సమాజాలతో మాట్లాడడం, సామర్ధ్యతను పెంచడం మరియు సేవలను ప్రత్యక్షంగా అందించడం చేస్తుంది. వారు ఆరోగ్య సేవలు, ఎడ్యుకేషనల్ ప్రోగ్రామ్లు, మరియు చట్టబద్ద జెండర్ గుర్తింపు సంబంధించిన ఆన్‌లైన్ వనరులను అందిస్తారు."},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Sylvia Rivera Law Project (SRLP)","description":"Sylvia Rivera Law ప్రాజెక్టు అన్ని వ్యక్తులు ఆదాయం లేదా జాతి, హేరాస్మెంట్, భేదభావం లేదా హింస ఎందుకు గురంగా లేకుండా ప్రత్యేక లింగ గుర్తించుటకు మరియు వ్యక్తీకరణకు స్వేచ్ఛతను హామీ ఇవ్వడానికి పనిచేస్తుంది. SRLP చట్టప్రమాణమైన సహాయాన్ని అందిస్తుంది, ప్రచారాలను ఆయోజిస్తుంది, శిక్షణలు నిర్వహిస్తుంది, మరియు ఒక ప్రిజనర్ కమిటీ కుర్రాళీ ఉపసంహరించుంది. సముదాయ సాందర్భికత దానాలు, స్వేచ్ఛాసేవ, మరియు సభ్యతను ప్రోత్సహించడానికి ప్రేరిస్తుంది."},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"ఉదయంలో ఈరిన్","description":"ట్రాన్స్ చట్టపు మరియు జీవనం పై వార్తలు మరియు చర్చ. ఈరిన్ రీడ్ చేత · అధిక 38,000 చందాదారులు"},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"ప్రపంచ వ్యాప్తంగా ఎల్జిబిటిక్యు+ హక్కుల కోసం ఓ వ్యాపకమైన మరియు తాజాగా ఉన్న వనరులను సృష్టించడానికి ముంగిలియు అన్ని విధాలలో ఉన్న ఒక ఆన్‌లైన్ వేదికగా EqualDex.com. వారి వెబ్‌సైట్ ప్రపంచవ్యాప్తంగా ఎల్జిబిటిక్యు+ హక్కుల పై చట్టాలు, విధానాలు, మరియు సమాజ దృష్టికోణాల కేంద్రీకృత డేటాబేస్‌ను అందిస్తుంది. సమానత్వ, సమావేశత, మరియు చట్టానికి ఉన్న రక్షణకు డేటాను మ్యాపింగ్ మరియు కనుగొనడం ద్వారా, EqualDex.com కృతాగ్నులు, పరిశోధకులు, మరియు ఎల్జిబిటిక్యు+ హక్కుల కోసం ప్రపంచ వ్యాపరాన్ని అర్థం చేసే మరియు అభ్యర్థించే వ్యక్తుల కోసం ఒక శక్తివంతమైన పరికరం మరియు ఒక ఉపకరణంగా పనిచేస్తుంది. వారి ప్రత్యేకితనమైన మ్యాప్లను అన్వేషించండి, దేశ ప్రత్యేకానికి ప్రొఫైల్‌లను బ్రౌజ్ చేయండి, మరియు ఎల్జిబిటిక్యు+ సముదాయంపై ఎదురుచూసే తాజా సంఘటనలు మరియు సవాలులు పై తెలివిగా ఉండండి."},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"స్ట్రాండ్స్ ఫర్ ట్రాన్స్ అనేది వర్ల్డ్వైడ్ హేర్, బ్యూటీ, మరియు వెల్నెస్ రంగాలు మరియు సంస్థల నెట్‌వర్క్ సాధంగా అనిపించి, ప్రతి అతిథికి, ప్రత్యేకంగా ట్రాన్స్ కమ్యూనిటీ నుండి వచ్చే అతిధులకు సురక్షితమైన మరియు పాజిటివ్ అనుభవాలను సృష్టించడానికి మరియు ప్రేరణ ఇవ్వడానికి ప్రయత్నిస్తుంది."},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"పసిఫిక్ సెంటర్ ఫర్ హ్యూమన్ గ్రోత్","description":"1973లో స్థాపించిన Pacific Center for Human Growth, బే ఏరియాలో అతి పాత లెస్బియన్లు, గేయ్స్, బై సెక్సుయల్, ట్రాన్స్, అండిఖానీ సెంటర్, దేశంలో మూడవ, మాత్రమే అలమేడా కౌంటీలో లెస్బియన్లు, గేయ్స్, బై సెక్సుయల్, LGBTQIA+ మరియు QTBIPOC ప్రజలు మరియు వారి కుటుంబాలకు మాత్రమే మానసిక ఆరోగ్య క్లినిక్ నిర్వహిస్తోంది."},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"ఓక్లాండ్ LGBTQ సముదాయ సేంటర్","description":"ఓక్లాండ్ యొక్క మొదటి సర్వత్ర ఆఫ్రోఫిట్ 501c3, అన్ని ఆయుస్సుల ప్రజలకు, అన్ని భాగస్వాముల కలిగిన LGBTQ సముదాయ సేవా కేంద్రం. మాతృభాషాసహాయ సమూహాలు, మానసికతత్వశాస్త్ర సమర్థనం, నివాస సహాయం, యువక ప్రోగ్రామ్, చట్టప్రతి క్లినిక్, ఆహార పానీయాల అంగరాఖణ మొదలగునే సేవలు అందించబడుచున్నాయి. LGBTQ+ ముత్యుల ప్రజలు మరియు త్రితీయ లింగి సముదాయ సభ్యుల కోసం ప్రత్యేక ప్రోగ్రాములు కూడా నిర్వహించబడుతున్నాయి."},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"లింగ వైవిధ్యత","description":"లింగ వైవిధ్యత అన్ని లింగ గుర్తులు మరియు ప్రకటనల కలలిగిన పిల్లలు మరియు వయోవృద్ధుల సరైనతను మెరుగుపరుచుతుంది. మనం విద్యా అందిస్తున్నాము, అవగాహనను పెంచుతున్నాము, మరియు మానవ అనుభవం యొక్క విస్తృత పరిధిలో అంతర్దృష్టిని అందిస్తున్నాము. మానం సేవించునే లింగ అనిష్ఠిత వ్యక్తుల కోసం పాఠశాలలు, క్రీడా జట్లు, ఉద్యోగ స్థలాలు, మరియు ఆరోగ్య సేవా సంచాలకుల్లో మద్దతిస్తున్నాము, మార్గదర్శించునే మరియు విభేజనాత్మకమైన పరిసరాలను సృష్టించలను."},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"జాతీయ ట్రాన్స్ జెండర్ సమత్వ కేంద్రం","description":"జాతీయ ట్రాన్స్ జెండర్ సమత్వ కేంద్రం అనేది ట్రాన్స్ జెండర్ వ్యక్తులకు అర్ధంచేసుకునే మరియు అంగీకరించే విధంగా సమాజ దృష్టాంతాలను మరియు విధానాలను మార్చడానికి ప్రచారణ చేయు సంస్థ . NCTE ముప్పు (ఏజింగ్), వైలెంస్ వ్యతిరేకత, ఉద్యోగం, కుటుంబాలు, కుల (హెల్త్ & హివ్), ఇంటి కౌటుంబికత (హౌసింగ్ & బెత్తలకు లేనివారు), మరియు మరియు మరిన్ని ప్రశ్నల గురించి సమాచారం అందిస్తుంది."},{"id":"8a206480-e41f-4bb6-9128-94d4b04cd997","slug":"the-inner-circle","externalUrl":"https://theinnercircle.org.za/","tags":["education-awareness","support-groups"],"address":"Lester Rd, Wynberg, Cape Town, 7824, South Africa","phoneNumber":"+27 (0) 21 761 0037","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-34.011883,18.469623],"email":"admin@theinnercircle.org.za","socialMedia":{"facebook":"https://www.facebook.com/pg/The-Inner-Circle-151896104833723/","twitter":"https://twitter.com/TIC_SouthAfrica"},"town":"Wynberg","title":"ఇన్నర్ సర్కిల్","description":"యొక్క ఆధ్యాత్మికత, విద్య, మరియు ఉగ్రత నిర్మాణం ద్వారా లైంగిక ఉపసంహారానికి మరియు లింగ అంగీకార ఆధారాన మిగిలిన ముస్లింలకు స్వస్థతను తేలుపటానికి ప్రయత్నిస్తున్న ప్రపంచ వ్యాప్తి ముస్లింల కమ్యూనిటీ"},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"ఫ్లోరిడా పేరు మార్పు హోమ్","description":"ఈ వెబ్‌సైట్ ఫ్లోరిడాలో వారి పేరు లేదా లింగాన్ని నవీకరించడానికి క్రమవర మార్గదర్శనను అందిస్తుంది. ఈ పద్ధతులు కోర్టులో ఫిర్యాదు నమోదు చేసేందుకు, సామాజిక భద్రతా కార్డు, డ్రైవర్ లైసెన్స్, పాస్పోర్ట్, మరియు జనన ప్రమాణ పత్రం అప్‌డేట్ చేసేందుకు ఉంటాయి."},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"ది ట్రేవర్ ప్రాజెక్ట్","description":"ది ట్రేవర్ ప్రాజెక్ట్ అనేది అమెరికన్ నాన్-ప్రాఫిట్ సంస్థ అంటే, LGBTQ+ యువతికి ఆత్మహత్య నివారణ సేవల అందిస్తుంది. ఆ సైట్ ట్రాన్స్‌జెండర్ సముదాయంలో ప్రయోజనకరమైన వనరులను అందిస్తుంది, దీనిలో ఆపద్వాన ప్రతిస్పందన మరియు ఆత్మహత్య నివారణ లైఫ్ లైన్, ట్రేవర్ చాట్, మరియు ట్రేవర్ టెక్స్ట్ లను కలిగిఉంటుంది, మరియు మానసిక ఆరోగ్య మీద మార్గదర్శనం, సామాజిక సేవలు, మరియు మద్దతు గుంపుల పై కూడా."},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"మార్షా కొరకు ఒక స్థలం","description":"మార్షా కొరకు ఒక ప్రదేశం, ప్రారంభ ప్రాజెక్టులలో ఒకటిగా పెరుగుతున్న ప్రమాదకరమైన నిలవగానున్న రాష్ట్రాల్లో ట్రాన్స్ వ్యక్తులు మరియు కుటుంబాలకు సహాయపడేందుకు లక్ష్యించింది. APFM 2023 మార్చ్ లో జాతీయస్థాయిలో ట్రాన్స్ బిల్లుల ప్రమాణాలు పెరుగుదలతో ప్రారంభించింది. APFM ఇప్పుడు ఎర్రి రాష్ట్రాల నుండి శరణార్థులను గృహసహచరులుగా మ్యాచింగ్ చేయడానికి కేంద్రీకరించింది, ఒక గృహసంస్థను జాగ్రత్తగా పరిచరించింది."},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"TransVoiceLessons ట్రాన్స్జెండర్ మరియు నాన్-బైనరీ వ్యక్తులకు మరింత పురుషవంతమైన, స్త్రీవంతమైన, లేదా ఆండ్రోజనె౗స్ అని అనిపించడానికి గురించిన గుణవంతమైన స్వర నియంత్రణ మరియు విమోచన సేవలను అందిస్తుంది."},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailroad.org","description":"జాతీయాతీత, లైంగిక గుర్తింపు కలిగి ఉన్న వ్యక్తులు ప్రపంచ వ్యాప్తంగా హింస మరియు హింసకేంద్రిత సంస్థల నుండి రక్షణ మరియు మోసం చెందాలనే ఉద్దేశంగా కలిగి ఉన్న ప్రధాన ఆన్‌లైన్ వేదిక. దృఢ ఉపకట్టేతో, ఈ వెబ్‌సైట్ ఆపద్వైపు పరిస్థితులు జరిగే వారిని స్వచ్ఛమైన శోధనాధారాలకు, అట్టంటి సహాయంగా మరియు సురక్షిత మార్గాలకు కనెక్ట్ చేస్తుంది. స్థానిక సంస్థలు మరియు కరుణాపూర్ణ మద్దతుదారుల నెట్వర్క్‌తో భాగస్వామ్యం, RainbowRailroad.org నిరంతరం ఆందోళన, చట్టప్రమాణ సహాయం, మరియు తరలింపు మద్దతును అందిస్తుంది, అదేవిధంగా వ్యక్తులు హింసను నీకొసంచి, ఆశ్రయాలను కనుగొనడానికి సాయం చేస్తుంది. మనవ హక్కులను రక్షిస్తూ, ప్రాణాలను కాపాడుతూ, మరియు మరిన్ని సమావేశకారీ ప్రపంచాన్ని ఉన్ముఖించే ద్వారా, RainbowRailroad.org సురక్షితత మరియు స్వేచ్ఛను శోధిస్తున్న లైంగిక గుర్తింపు కలిగి ఉన్న వ్యక్తులకు ఆశాదీపం మరియు రక్షణని అందిస్తుంది."},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"ది మెక్కెన్జీ ప్రాజెక్ట్","description":"లింగ న్యాయానికి ప్రోత్సాహించే మరియు ట్రాన్స్జెండర్ సముదాయాన్ని సేవించే సేవలు, కార్యక్రమాలు మరియు ఈవెంట్లను అందిస్తున్న విస్తృత వనరు. సహాయక సేవలు మరియు వనరులను కలిగి ఉంటాయి, అవి ఆరోగ్య సేవలు, చట్టప్రమాణ సహాయం, మానసిక ఆరోగ్య సేవలు మరింత ఉండగలవు."},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"ఈస్ట్ బే ట్రాన్స్ & క్వీర్ కౌన్సిలింగ్","description":"మధ్యమమైన బర్కలీ, CA లో దొరికే వ్యక్తిగత చికిత్సను కలిపిన నమోదు చేసే సేవలు ఈస్ట్ బే ట్రాన్స్ & క్వీర్ కౌన్సిలింగ్ అందిస్తుంది: లింగ అన్వేషణ మరియు మార్పుకు మద్దతు. హార్మోన్స్ మరియు శస్త్రచికిత్స కోసం సిఫారసు లేఖలు. మానసిక ఆరోగ్య సరఫరాదారులు, విద్యార్థులు, ఉద్యోగిస్తుల కోసం ప్రొఫెషనల్ శిక్షలు. సామ్ డేవిస్ ఒక ట్రాన్స్జెండర్, జెండర్క్వీర్ లైసెన్సింగ్ క్లినికల్ సోషల్ వర్కర్ (LCSW) ఆరుటు, ట్రాన్స్, క్వీర్, జెండర్క్వీర్, మరియు జెండర్-నాన్ కంఫార్మింగ్ కిశోరులు మరియు వయోధికమైన వ్యక్తులతో పనిచేసే ప్రత్యేకతతో. ఈస్ట్ బేలో అందుబాటులో మానసిక ఆరోగ్య సరఫరాదారుగా 16 సంవత్సరాల అనుభవం ఉంది, అతనిలో పీర్ మద్దతు సమూహ ప్రేరేణ, LGBTQI సమ్మేళనలలో సముదాయ విద్యానివేతన, ఆలమేడా కౌంటీ కోసం గూడితట్టిన ప్రజలుతో క్లినికల్ చికిత్సా మరియు సంకట కౌన్సిలింగ్తో పాటు 9 సంవత్సరాలు. వేలకు గురుచేతులుగా పనిచే సౌకర్యమైన ప్రత్యేక హక్కుబాధులు."},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"ట్రాన్స్‌జెండర్ మ్యాప్","description":"Transgendermap.com అనేది తమ లింగ గుర్తింపును ప్రశ్నించే వారికి లేదా ట్రాన్స్‌జెండర్ అవధిలో ఏదో ఒక్కటిగా ఉండే వారికి అనువర్తనాత్మక సమాచారాన్ని మరియు మార్గదర్శనాన్ని అందించడానికి దృష్టిలో పెట్టుకునే ఆన్‌లైన్ సంసాధనం. ఈ వెబ్‌సైట్‌లో ట్రాన్స్‌జెండర్ నిఘంటువును అర్ధం చేసుకునేందుకు, మారుదలపై ప్రక్రియలు, చట్టపరమైన సమస్యలు, ఆరోగ్య పరేక్షణానికి, మరియు అనేక వ్యక్తిగత కథలు వంటి వివిధ అంశాలు ఉంటాయి. దీని లక్ష్యం \'మ్యాప్\' లేదా లింగ గుర్తించుకునే అనేక అంశాలను మార్గదర్శకంగా అందిస్తూ వ్యక్తులు తమ వ్యక్తిగత ప్రయాణాలను నడుపుకోవడానికి సహాయపడడానికి ఉంది. అత్యంత నగదు మరియు ఖచ్చితమైన సమాచారాన్ని కొరకు ఆసలైన సైటును సందర్శించండి."},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"ట్రాన్స్ కుటుంబాలు","description":"ట్రాన్స్ కుటుంబాలు ఆశానికి ప్రేరణ ఇస్తుంది, అర్ధాన్ని పెంచుతుంది, మరియు వారి జీవితాలను తాకే అన్ని వ్యక్తులకు మద్దతు మరియు ప్రాతిపదిక లింగ వైవిధ్యతను మద్దతు చేయడానికి ఒక కనిపించే మార్గాన్ని సృష్టిస్తుంది. మేము వనరులను అందిస్తాము, ఈవెంట్లను నిర్వహిస్తాము, మరియు కుటుంబాలను మద్దతు సమూహాలకు కనేక్ట్ చేస్తాము."}]')}}]);